Salmos 119:9 | ARC

9 Como purificará o jovem o seu caminho? Observando-o conforme a tua palavra. 

@aplicativodabiblia

COMO SE LIBERTAR DO PASSADO

❖ DELETAR O PASSADO NÃO É COM DEUS, É COM VOCÊ 

❖ SE VOCÊ NÃO “DER DE OMBROS” PARA O PASSADO, O SEU PRESENTE SERÁ TRAVADO (EXEMPLO MARIA MADALENA).

3 PRINCÍPIOS PARA SE LIBERTAR DO PASSADO:

1. DELETE O SEU PASSADO; 

2. COM DEUS SEMPRE TEM ALGO NOVO; 

3. DEUS FAZ CAMINHOS NOS LUGARES DISTANTES E RIOS NOS DESERTOS.

3 PONTOS PARA ACESSAR O NOVO (PEDIR PARA ANOTAR):

1. PERDÃO; 
2. ORAÇÃO; 
3. CONVIVER COM PESSOAS SAUDÁVEIS.

5 COISAS QUE CHEGAM COM O  NOVO:

✓ MEDOS; 
✓ INSEGURANÇAS; 
✓ AMIZADES; 
✓ RELACIONAMENTOS;
✓ PORTAS ABERTAS.

3 CONSELHOS FINAIS:

1. REEDITE O PASSADO (ERROS, CULPAS, OFENSAS...); 2. OLHE PARA A FRENTE (FUTURO); 

3. ESTEJA ATENTO AS NOVAS ORDENS DE DEUS.

❖ PARA CADA FASE DA VIDA DEUS TE DÁ UMA HABILIDADE NOVA.

Essa arrepiaaa🔥🔥

